import Button from "react-bootstrap/Button";
import Form from "react-bootstrap/Form";

function FormItem() {
  return (
    <Form>
      <Form.Label>הוספת פריט חדש לרשימה </Form.Label>
      <Form.Control type="email" placeholder="הכניסי פריט חדש" />

      <Button variant="primary" type="submit">
        אישור
      </Button>
    </Form>
  );
}

export default FormItem;
